	update: function() {
		// Update all entities and backgroundMaps
		this.parent();
		
		// camera control
		if (ig.input.pressed('leftClick')) {
			// set the starting point
			this.mouseLast.x = ig.input.mouse.x;
			this.mouseLast.y = ig.input.mouse.y;	
		}
	  
		if (ig.input.state('leftClick')) {
			/*this.screen.x -= ig.input.mouse.x - this.mouseLast.x;
			this.screen.y -= ig.input.mouse.y - this.mouseLast.y;
			this.mouseLast.x = ig.input.mouse.x;
			this.mouseLast.y = ig.input.mouse.y;	*/

			var r = 25;
			var mx = ig.input.mouse.x + this.screenOffset;
			var my = ig.input.mouse.y;

			for(var i = 0; i < ig.game.entities.length; i++)
			{
				var ex = ig.game.entities[i].pos.x;
				var ey = ig.game.entities[i].pos.y;	

				var xd = mx - ex;
				var yd = my - ey;
				var dist = Math.sqrt(xd*xd + yd*yd);
				
				if(dist < r)
				{
					ig.game.entities[i].kill();
					this.kills.push({entityx: ex, entityy: ey});
				}					

			}		  
		}
		
		if (ig.input.state('scrollRight')) {
			this.screen.x += 5;
			this.screenOffset += 5;
		}
		
		if (ig.input.state('scrollLeft')) {
			this.screen.x -= 5;
			this.screenOffset += 5;
		}
	},
	
